import React from 'react';
import CheckIcon from '@material-ui/icons/Check';
import DeleteIcon from '@material-ui/icons/Delete';
import { useState } from 'react';

const List = (props) => {
  const [line, setLine] = useState(false);
  const CheckFun = () => {
    setLine(true);
  };
  return (
    <ol>
      <li style={{ textDdecoration: line ? 'line-through' : 'none' }}>
        {props.text}
      </li>
      <span className='list_btn'>
        <CheckIcon className='ch_btn btn' onClick={CheckFun} />

        <DeleteIcon className='del_btn btn' />
      </span>
    </ol>
  );
};

export default List;
